#!/usr/bin/python3
# encoding=utf-8

# Serial receiver
# Teensy sends Screenshot over Serial
# Version with compression on identical pixel color
# https://www.designer2k2.at
# 2021.05.02

from PIL import Image
import numpy as np


def string2screenshot(screenshotstring, imagename, showimage):
    # dtoe must be the string between "==== PIXEL DATA START ====" and "==== PIXEL DATA END ===="
    dtoe = screenshotstring

    # Image size:
    w, h = 320, 240
    data = np.zeros((h, w, 3), dtype=np.uint8)

    x, y = 0, 0

    totalsize = len(dtoe) - 8
    sizeval = int(dtoe[totalsize : totalsize + 8], 16)

    if not (totalsize == sizeval):
        print(
            "Size does not match, no decoding. Length:{}, encoded length{}".format(
                totalsize, sizeval
            )
        )
    else:
        print("Size match, lets decode! Size: {}".format(sizeval))
        recovered = 0
        uncompressed = 0
        for i in range(0, sizeval, 10):
            chunk = dtoe[i : i + 10]
            r = int(chunk[0:2], 16)
            g = int(chunk[2:4], 16)
            b = int(chunk[4:6], 16)
            count = int(chunk[6:10], 16)
            if count == 1:
                uncompressed += 1
            else:
                recovered += count
            for p in range(count):
                data[y, x] = [r, g, b]
                x = x + 1
                if x > 319:
                    x = 0
                    y = y + 1
        print("Recovered pixel: {}, uncompressed: {}".format(recovered, uncompressed))
        img = Image.fromarray(data, "RGB")
        img.save(imagename)
        if showimage:
            img.show()


if __name__ == "__main__":

    example = ""
    string2screenshot(example, "example.png", True)
